    e.preventDefault();
    console.log(this.state.name);
  }
  render() {
    return (
      <div className="App">
      <h1> react app</h1>
        <p> welcome </p>
        <Ninja />
        <div className="ninja-list"> </div>
        <List list = {this.state.ninjas} />
      </div>
    );
  }
} 


export default App;
